import React from "react"
import ReactDOM from "react-dom"

function Card(props){
    return(
<div>
    <h1>{props.name} </h1>
   <img src={props.img} />
    <p>{props.email}</p>
</div>
    )
}
function Card2(props){
    return(
<div>
    <h1>{props.name} </h1>
   <img src={props.img} />
    <p>{props.email}</p>
</div>
    )
}


ReactDOM.render(  <div>
    <h1>My Contacts</h1>
    <Card name="Mike" img="images/DSC_6949.jpg" email="07064846659" />
    <Card2 name="Omos" img="images/DSC_6949.jpg" email="07064846659" />
    
</div>, document.getElementById("root"))
